export const styles = {
    "chatOnline": {
      "flex": "4",
      height: '100%'
    },
    "chatOnlineWrapper": {
      "height": "100%",
    },
    "@media screen and (max-width: 768px)": {
      "__expression__": "screen and (max-width: 768px)",
      "chatOnline": {
        "flex": "1px"
      }
    }
  }
